class BreagedetailsComponent {
    constructor(dataservice) {
        this.dataservice = dataservice;
        this.collection = [];
        this.HighlightHead = 1;
        this.SearchField = 'Type';
        this.BackUpdata = [];
        this.timeout = null;
        this.selectedCountryAdvanced = [];
        this.filteredCountries = [];
        this.countries = [];
        this.TableHeading = [
            {
                name: 'SI No',
            },
            {
                name: 'Type',
            },
            {
                name: 'Create On',
            },
            {
                name: 'Create By',
            },
            {
                name: 'Update On',
            },
            {
                name: 'Update By',
            },
            {
                name: 'Edit',
            },
            {
                name: 'Delete',
            },
        ];
    }
    ngOnInit() {
        this.tabledata();
        this.dataservice
            .getfromAssest(`assets/model/countries.json`)
            .subscribe((data) => {
            this.countries = data;
            console.log(this.countries);
        });
    }
    filterCountry(event) {
        //in a real application, make a request to a remote url with the query and return filtered results, for demo we filter at client side
        let filtered = [];
        let query = event.query;
        for (let i = 0; i < this.countries.length; i++) {
            let country = this.countries[i];
            if (country.name.toLowerCase().indexOf(query.toLowerCase()) == 0) {
                filtered.push(country);
            }
        }
        this.filteredCountries = filtered;
    }
    tabledata() {
        this.dataservice
            .getfromAssest('assets/model/category.json')
            .subscribe((data) => {
            this.collection = data;
            this.BackUpdata = data;
        });
    }
    Click_Head(index, heading) {
        this.collection = [...this.BackUpdata];
        if (heading == 'Type' || heading == 'Create On') {
            this.SearchField = heading;
            this.HighlightHead = index;
            this.searchvalue = '';
        }
        else {
            // this.toastr.info(`Search Field Invalid`);
        }
    }
    Empty() {
        if (!this.searchvalue) {
            this.collection = [...this.BackUpdata];
        }
    }
    onKeySearch(event) {
        clearTimeout(this.timeout);
        var $this = this;
        this.timeout = setTimeout(function () {
            if (event.keyCode != 13) {
                $this.SearchBy();
            }
        }, 1000);
    }
    SearchBy() {
        // this.searchvalue = this.searchvalue.toUpperCase();
        if (this.searchvalue) {
            if (this.SearchField == 'Type') {
                this.collection = this.collection.filter((f) => f.type == this.searchvalue);
            }
            else if (this.SearchField == 'Date') {
                this.collection = this.collection.filter((f) => f.type == this.searchvalue);
            }
        }
    }
}
