class CatogerymasterComponent {
    constructor(dataservice, toastr, router) {
        this.dataservice = dataservice;
        this.toastr = toastr;
        this.router = router;
        this.collection = [];
        this.HighlightHead = 1;
        this.SearchField = "Type";
        this.BackUpdata = [];
        this.timeout = null;
        this.registerDetails = {};
        this.showButton = false;
        this.TableHeading = [
            {
                name: "SI No",
            },
            {
                name: "Type",
            },
            {
                name: "Create On",
            },
            {
                name: "Create By",
            },
            {
                name: "Update On",
            },
            {
                name: "Update By",
            },
            {
                name: "Edit",
            },
            {
                name: "Delete",
            },
        ];
    }
    ngOnInit() {
        this.tabledata();
    }
    // Get All Data
    tabledata() {
        this.dataservice
            .getView()
            .subscribe((data) => {
            // console.log(data.data);
            this.collection = data.data;
            this.BackUpdata = data.data;
        });
    }
    // Delete the Particular Data
    deleteUsers(id) {
        // console.log(id);
        this.dataservice.DeleteSingleUser(id, this.collection).subscribe((data) => {
            this.tabledata();
        }, err => console.log('its error'));
    }
    // Insert the New Data
    store() {
        if ((this.registerDetails.category === undefined) || (this.registerDetails.category === "")) {
            alert("Enter the Details");
        }
        else {
            this.dataservice.postUser(this.registerDetails).subscribe((data) => {
                // alert("Added");
                if (data.data) {
                    this.toastr.success('Created!!!', 'Category Created Successfully.', {
                        timeOut: 3000,
                    });
                    let currentUrl = this.router.url;
                    this.router.routeReuseStrategy.shouldReuseRoute = () => false;
                    this.router.onSameUrlNavigation = 'reload';
                    this.router.navigate([currentUrl]);
                    this.tabledata();
                }
                else {
                    if (data.error.errors[0].validatorKey) {
                        this.toastr.error('Error!!!', 'Category Already Exists.', {
                            timeOut: 3000,
                        });
                    }
                }
                // console.log(data.error.errors[0].validatorKey);
            }, err => console.log('its error'));
        }
    }
    // Update the Exist Data
    update() {
        if ((this.registerDetails.category === "") || (this.registerDetails.category === undefined)) {
            alert("Enter the Details");
        }
        else {
            this.dataservice.updateSingleUser(this.registerDetails.id, this.registerDetails).subscribe((data) => {
                // alert("Update");
                // console.log(data);
                if (data.data) {
                    this.toastr.success('Updated!!!', 'Category Updated Successfully.', {
                        timeOut: 3000,
                    });
                    let currentUrl = this.router.url;
                    this.router.routeReuseStrategy.shouldReuseRoute = () => false;
                    this.router.onSameUrlNavigation = 'reload';
                    this.router.navigate([currentUrl]);
                    this.tabledata();
                }
                else {
                    if (data.error.errors[0].validatorKey) {
                        this.toastr.error('Error!!!', 'Category Already Exists.', {
                            timeOut: 3000,
                        });
                    }
                }
            }, (err) => console.log(err));
        }
    }
    getUser(id) {
        this.registerDetails = Object.assign({}, id);
    }
    Click_Head(index, heading) {
        this.collection = [...this.BackUpdata];
        if (heading == "Type") {
            this.SearchField = heading;
            this.HighlightHead = index;
            this.searchvalue = "";
        }
        else {
            // this.toastr.info(`Search Field Invalid`);
        }
    }
    Empty() {
        if (!this.searchvalue) {
            this.collection = [...this.BackUpdata];
        }
    }
    onKeySearch(event) {
        clearTimeout(this.timeout);
        var $this = this;
        this.timeout = setTimeout(function () {
            if (event.keyCode != 13) {
                $this.SearchBy();
            }
        }, 1000);
    }
    SearchBy() {
        // console.log(this.collection);
        // this.searchvalue = this.searchvalue.toUpperCase();
        if (this.searchvalue) {
            if (this.SearchField == "Type") {
                this.collection = this.collection.filter(f => f.category == this.searchvalue);
            }
            // else if (this.SearchField == "Create On") {
            //   // console.log(this.collection);
            //   this.collection = this.collection.filter(f => console.log(f.createdAt == this.searchvalue));
            //   console.log(this.collection);
            // }
        }
    }
    // Clear the data
    reset() {
        this.registerDetails.category = '';
    }
}
