class GaugesmasterComponent {
    constructor(dataservice, toastr, router) {
        this.dataservice = dataservice;
        this.toastr = toastr;
        this.router = router;
        this.registerDetails = {};
        this.collection = [];
        this.BackUpdata = [];
        this.Type = [];
        this.Category = [];
        this.timeout = null;
        this.HighlightHead = 3;
        this.SearchField = "Short Name";
        this.TableHeading = [
            {
                name: "SI No",
            },
            {
                name: "Category",
            },
            {
                name: "Type",
            },
            {
                name: "Short Name",
            },
            {
                name: "Create On",
            },
            {
                name: "Create By",
            },
            {
                name: "Update On",
            },
            {
                name: "Update By",
            },
            {
                name: "Edit",
            },
            {
                name: "Delete",
            },
        ];
    }
    ngOnInit() {
        this.tabledata();
        this.getType();
        this.getCategory();
    }
    getType() {
        this.dataservice
            .MasterType_getView()
            .subscribe((data) => {
            console.log(data.data[0].type);
            this.Type = data.data;
            // this.BackUpdata = data.data;
        });
    }
    getCategory() {
        this.dataservice
            .MasterCategory_getView()
            .subscribe((data) => {
            console.log(data.data[0].category);
            this.Category = data.data;
            // this.BackUpdata = data.data;
        });
    }
    tabledata() {
        this.dataservice
            .Gauges_getView()
            .subscribe((data) => {
            // console.log(data.data);
            // console.log(data.data[0].CategoryMaster.id);
            // console.log(data.data[0].CategoryMaster.category);
            this.collection = data.data;
            this.BackUpdata = data.data;
        });
        // console.log(this.collection);
    }
    update() {
        if ((this.registerDetails.shortName === undefined) || (this.registerDetails.categoryId === undefined) || (this.registerDetails.typeId === undefined) || (this.registerDetails.shortName === "")) {
            alert("Enter the Details");
        }
        else {
            // this.submitted = true;
            this.dataservice.Gauges_updateSingleUser(this.registerDetails.id, this.registerDetails).subscribe((data) => {
                // alert("Update");
                // console.log(data);
                if (data.data) {
                    this.toastr.success('Updated!!!', 'Gauges Updated Successfully.', {
                        timeOut: 3000,
                    });
                    let currentUrl = this.router.url;
                    this.router.routeReuseStrategy.shouldReuseRoute = () => false;
                    this.router.onSameUrlNavigation = 'reload';
                    this.router.navigate([currentUrl]);
                    this.tabledata();
                }
                else {
                    if (data.error.errors[0].validatorKey) {
                        this.toastr.error('Error!!!', 'Equipment Already Exists.', {
                            timeOut: 3000,
                        });
                    }
                }
            }, (err) => console.log(err));
        }
    }
    getUser(id) {
        this.registerDetails = Object.assign({}, id);
    }
    deleteUsers(id) {
        // console.log(id);
        this.dataservice.Gauges_DeleteSingleUser(id, this.collection).subscribe((data) => {
            this.tabledata();
        }, err => console.log('its error'));
    }
    store() {
        if ((this.registerDetails.shortName === undefined) || (this.registerDetails.categoryId === undefined) || (this.registerDetails.typeId === undefined) || (this.registerDetails.shortName === "")) {
            alert("Enter the Details");
        }
        else {
            this.dataservice.Gauges_postUser(this.registerDetails).subscribe((data) => {
                // alert("Added");
                // console.log("Inserted"+data);
                if (data.data) {
                    this.toastr.success('Created!!!', 'Equipment Created Successfully.', {
                        timeOut: 3000,
                    });
                    let currentUrl = this.router.url;
                    this.router.routeReuseStrategy.shouldReuseRoute = () => false;
                    this.router.onSameUrlNavigation = 'reload';
                    this.router.navigate([currentUrl]);
                    this.tabledata();
                }
                else {
                    if (data.error.errors[0].validatorKey) {
                        this.toastr.error('Error!!!', 'Equipment Already Exists.', {
                            timeOut: 3000,
                        });
                    }
                }
            }, err => console.log('its error'));
        }
    }
    Click_Head(index, heading) {
        this.collection = [...this.BackUpdata];
        if (heading == "Short Name") {
            this.SearchField = heading;
            this.HighlightHead = index;
            this.searchvalue = "";
        }
        else {
            // this.toastr.info(`Search Field Invalid`);
        }
    }
    Empty() {
        if (!this.searchvalue) {
            this.collection = [...this.BackUpdata];
        }
    }
    onKeySearch(event) {
        clearTimeout(this.timeout);
        var $this = this;
        this.timeout = setTimeout(function () {
            if (event.keyCode != 13) {
                $this.SearchBy();
            }
        }, 1000);
    }
    SearchBy() {
        // this.searchvalue = this.searchvalue.toUpperCase();
        if (this.searchvalue) {
            if (this.SearchField == "Short Name") {
                this.collection = this.collection.filter(f => f.shortName == this.searchvalue);
            }
            // else if (this.SearchField == "Date") {
            //   this.collection = this.collection.filter(f => f.type == this.searchvalue);
            // }
        }
    }
    reset() {
        this.registerDetails.shortName = "";
    }
}
